// DSL
// Palindrome not counting the space left and right
fun String.isPalindrome() : Boolean  {
    if ( this.length <= 1 ) return false
    if ( this.length == 2 ) return this[0]==this[1]
//    println("in: $this")
    //val end = this.length/2-1  //if(this.length%2 == 0) this.length/2-1 else this.length/2-1
    var left = 0
    var right = this.length-1

    // Special check mid char is not space
    if (this.length%2 != 0 && this[this.length/2] == ' ') return false

    // Trim
    while (this[left] == ' ') left++
    while (this[right] == ' ') right--

    while ( left >= 0 && (left < right) ){
        if ( this[left] == this[right] ){
            left++
            right--
        }else return false
    }
    println("Palindrome found $this")
    return true
}

fun String.isPalindrome2() : Boolean  {
    if ( this.length <= 1 ) return false
    if ( this.length == 2 ) return this[0]==this[1]

    val input = this.trim()
    var left = 0
    var right = input.length-1
    while ( left >= 0 && (left < right) ){
        if ( input[left] == input[right]){
            left++
            right--
        }else return false
    }
    println("Palindrome found $input")
    return true
}


